import React from 'react'
import './Background.scss';
import city01 from '../../assets/images/city01.png';

const Background = () => {
  const styles = {
    backgroundImage: "url(" + city01 + ")",
    backgroundSize: 'cover',
    width: '100%',
    height: '100vh',
  }

  return (
    <React.Fragment>
      <div className="row wrapper" style={styles}>
        <div className="overlay blue"></div>
      </div>
    </React.Fragment>
  )
}

export default Background;
